create table stg.contracts (
    id serial primary key,
    currency varchar(15),
    address_test varchar(255),
    address_prod varchar(255),
    is_deleted bool default false,
    update_date date default current_date
);

create table stg.transaction_states (
    id integer primary key,
    title VARCHAR(255),
    is_deleted bool default false,
    update_date date default current_date
);

create table stg.gates (
    id integer primary key,
    title VARCHAR(20),
    is_deleted bool default false,
    update_date date default current_date
);

create table stg.projects (
	id serial primary,
	title text,
	api_key text,
    is_deleted bool default false,
    update_date date default current_date
);

create table stg.transactions (
	id integer,
	transaction_hash text,
    external_wallet_address text,
    owner_wallet_address text,
    amount varchar(100),
    fee varchar(100),
    contract_id int,
    transaction_state_id int,
    gate_id int,
    project_id int,
	create_date date
);

create table dwh.contracts (
    id serial primary key,
    bk_contract_id int,
    currency varchar(15),
    address_test varchar(255),
    address_prod varchar(255),
    is_deleted bool default false,
    update_date date default current_date
);

create table dwh.projects (
	id serial primary key,
    bk_project_id int,
	title text,
	api_key text,
    is_deleted bool default false,
    update_date date default current_date
);


create table dwh.transactions (
	id serial primary key,
	transaction_hash text,
    external_wallet_address text,
    owner_wallet_address text,
    amount varchar(100),
    fee varchar(100),
    contract_id int,
    project_id int,
    create_date date
);

CREATE TABLE contracts (
    id SERIAL PRIMARY KEY,
    currency VARCHAR(15),
    address_test VARCHAR(255),
    address_prod VARCHAR(255)
);

CREATE TABLE transaction_states (
    id INTEGER PRIMARY KEY,
    title VARCHAR(255)
);

CREATE TABLE gates (
    id SERIAL PRIMARY KEY,
    title VARCHAR(20)
);

CREATE TABLE projects (
    id SERIAL PRIMARY KEY,
    title VARCHAR(255) NOT NULL,
    api_key VARCHAR(255) NOT NULL
);

CREATE TABLE transactions (
    id BIGSERIAL PRIMARY KEY,
    transaction_hash VARCHAR(256) NOT NULL,
    external_wallet_address VARCHAR(100) NOT NULL,
    owner_wallet_address VARCHAR(100),
    amount NUMERIC(30, 18),
    contract_id BIGINT REFERENCES contracts(id),
    fee NUMERIC(30, 18) DEFAULT 0.0,
    is_prod_network SMALLINT DEFAULT 0,
    transaction_state_id INT REFERENCES transaction_states(id),
    gate_id INT REFERENCES gates(id),
    project_id BIGINT REFERENCES projects(id),
    ext_id BIGINT,
    block_number BIGINT,
    block_conf INT DEFAULT 20,
    create_date TIMESTAMP NOT NULL DEFAULT NOW(),
    update_date TIMESTAMP NOT NULL DEFAULT NOW()
);


